const prices = {
  common: {
    periods: [
      {
        price: 150,
        hour: 3,
      },
      {
        price: 175,
        hour: 4,
      },
      {
        price: 195,
        hour: 5,
      },
    ],
    expressFee: 50,
    expressPeriod: 7,
  }
};

export default prices;
